namespace RonSijm.FluidHumidifier.Factories.DataZone;

public class DataSourceFactory(string resourceName = null, Action<Humidifier.DataZone.DataSource> factoryAction = null) : ResourceFactory<Humidifier.DataZone.DataSource>(resourceName)
{

    internal List<InnerDataSourceFormInputFactory> AssetFormsInputFactories { get; set; } = [];

    internal InnerDataSourceDataSourceConfigurationInputFactory ConfigurationFactory { get; set; }

    internal InnerDataSourceScheduleConfigurationFactory ScheduleFactory { get; set; }

    internal InnerDataSourceRecommendationConfigurationFactory RecommendationFactory { get; set; }

    protected override Humidifier.DataZone.DataSource Create()
    {
        var dataSourceResult = CreateDataSource();
        factoryAction?.Invoke(dataSourceResult);

        return dataSourceResult;
    }

    private Humidifier.DataZone.DataSource CreateDataSource()
    {
        var dataSourceResult = new Humidifier.DataZone.DataSource
        {
            GivenName = InputResourceName,
        };

        return dataSourceResult;
    }
    public override void CreateChildren(Humidifier.DataZone.DataSource result)
    {
        base.CreateChildren(result);

        result.AssetFormsInput = AssetFormsInputFactories.Any() ? AssetFormsInputFactories.Select(x => x.Build()).ToList() : null;
        result.Configuration ??= ConfigurationFactory?.Build();
        result.Schedule ??= ScheduleFactory?.Build();
        result.Recommendation ??= RecommendationFactory?.Build();
    }

} // End Of Class

